Reference the attached image. My color theme is oriented towards green, as can be seen in border of the focused Title text field, and by the selected entry in the Categories list. There appears to be no appearance characteristic that alters the selected text color, the light blue shown here for the selected Title text. 

From the mailing list discussion:

2012/2/11 Norbert Schröder
-----------------------------
Your posting now reminded me of the problem, so I googled a bit and
finally found this thread at stackoverflow.com:
http://stackoverflow.com/questions/2043695/textareaselection-and-moz-selection.
This was the essential hint, and I found a solution for Firefox which
I've successfully tested with my di-lemmata application using the DarkTheme:

Attach a CSS file to your application and add the following style
definition:

p::-moz-selection, input::-moz-selection, textarea::-moz-selection,
div::-moz-selection {
  color: <myColor>;
  background-color: <myBackgroundColor>;
}



2012/2/11 Derrell Lipman
-----------------------------
This page has a more complete cross-browser setting that could be used in the appearance system, if it's not already there:
http://stackoverflow.com/questions/7224445/css3-selection-behaves-differently-in-ff-chrome

Here's the relevant excerpt from that page:

For some reason Chrome forces it to be semi-transparent. However, you can get around this by setting the background using rgba. I have set the alpha value to be just 0.01 less than 1. Live example: http://jsfiddle.net/tw16/m8End/

p::-moz-selection {
    background:rgba(255, 255, 125, 0.99);
    color:#032764;
}

p::-webkit-selection {
    background:rgba(255, 255, 125, 0.99);
    color:#032764;
}

p::selection {
    background:rgba(255, 255, 125, 0.99);
    color:#032764;
}
